  return (
    <header>
        <div></div>
      <div className="logo">
        <img src={""} alt="Logo" />
      </div>
      <div className="search-bar">
        <input id="search-text" type="text" placeholder="Search for Products, Brands and More" />
        <img src={searchIcon} alt="Search" className="search-icon" />
      </div>
      <nav>
        {/* Navigation links go here */}
      </nav>
    </header>
  );
};

export default Header;
